import './App.css';
import NavbarButton from './components/NavbarButton';

function App() {
  return (
    <div className="App">
      <header>
        <div id='logo-container'>
          <button id='button-index'>Dekkvar</button>
        </div>
        <div id='navbarButton-container'>
          <NavbarButton>About me</NavbarButton>
          <NavbarButton>My projects</NavbarButton>
          <NavbarButton>Contact me</NavbarButton>
        </div>
      </header>
    </div>
  );
}

export default App;
